import * as React from 'react';
import styled from 'styled-components';
import Navigation from '../components/Navigation';

const Container = styled.div`
  margin: 0;
  padding: 0;
`;

function ThirdPage() {
  return (
    <Container>
      <Navigation title={"ThirdPage"}/>
      <div>
        Welcome
      </div>
    </Container>
  )
};

export default ThirdPage;
